// src/components/HeroSection.js
import React from 'react';
import '../styles/HeroSection.css';

const HeroSection = () => {
    return (
        <section className="hero">
            <div className="hero__content">
                <h1>Hello, I'm Udhaya Kumar A</h1>
                <p className="hero__tagline">Aspiring Public Speaker, AI Enthusiast, and Technology Innovator</p>
                <p className="hero__description">
                    A Computer Science Engineering student passionate about harnessing the power of AI and technology to solve real-world challenges. Currently exploring opportunities in research and development, I aim to make impactful contributions through projects in AI, machine learning, and software engineering.
                </p>
                <div className="hero__buttons">
                    <a href="#projects" className="button primary">View Projects</a>
                    <a href="/path/to/resume.pdf" target="_blank" className="button secondary">Download Resume</a>
                </div>
            </div>
        </section>
    );
};

export default HeroSection;
